@prefix : <http://www.semanticweb.org/ontologies/hospital#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

:InsuranceDetailsValidation rdf:type owl:Class ;
                            rdfs:subClassOf :SystemProcess .

:PatientAdmission rdf:type owl:Class ;
                  rdfs:subClassOf :HospitalProcess ;
                  rdfs:subClassOf [ rdf:type owl:Restriction ;
                                    owl:precedes :InsuranceDetailsValidation ].

:SystemProcess rdf:type owl:Class .
:HospitalProcess rdf:type owl:Class .
